B.Ag=new A.c2('Das folgende Applet zeigt das B\xe4nderdiagramm (links) sowie das Energie-Impuls Diagramm (rechts) eines direkten bzw. eines indirekten Halbleiters. Der darzustellende Halbleitertyp kann mit Hilfe des Auswahlfeldes "Semiconductor type" ausgew\xe4hlt werden. Bet\xe4tigt man anschlie\xdfend die "Start Generation"-Schaltfl\xe4che, so wird das Auftreffen eines Photons auf den Halbleiter und die damit verbundene Generation eines Elektron-Loch-Paares animiert. Auf die gleiche Weise kann anschlie\xdfend die Animation der Thermalisierung und der Rekombination gestartet werden.\n\nMan sieht:\n',B.KV,"englisch",B.iS,null)
